import React from 'react';
import { makeStyles } from '@material-ui/core';
import { AppBar, Toolbar, Button, Select, MenuItem } from '@material-ui/core';
import { Card } from '@material-ui/core';
import { CloseIcon } from '../assets';

const useStyles = makeStyles((theme) => ({
    WindowHeader: {
        background: '#2A3E4C',
        borderRadius: '10px 10px 0px 0px',
        width: window.innerWidth - 160,
        position: 'static',
    },
    Title: {
        color: '#FFFFFF',        
    },
    TopRightMenu: {
        broder: '2px solid white',
        position: 'fixed',
        right: '110px',
        display: 'flex'
    },
    CloseButton: {
        paddingLeft: '0px',
        paddingRight: '0px',
        width: '25px',
        height: '25px',
        border: '2px solid white',
    },
    Dropdown: {
        width: '180px',
        color: '#FFFFFF',
        // paddingLeft: '-50px',
    },
}));

const WindowHeader = () => {
    const classes = useStyles();
    const [ template, setTemplate ] = React.useState('');
    const handleChange = (event) => {
        setTemplate(event.target.value);
    }
    return (
        <AppBar className={classes.WindowHeader}>
            <Toolbar>
                <div className={classes.Title}>
                    View Correspondence (2)
                </div>
                <div className={classes.TopRightMenu}>
                    <div style={{ paddingTop: '10px', paddingBottom: '10px' }}>
                        <Select 
                            className={classes.Dropdown} 
                            disableUnderline={true}
                            onChnage={handleChange}
                            value={template}
                        >
                            <MenuItem value="Template 1" style={{paddingLeft: '20px'}}>Template 1</MenuItem>
                            <MenuItem value="Template 2">Template 2</MenuItem>
                        </Select>
                    </div>
                    <div style={{ paddingTop: '10px', paddingBottom: '10px', paddingLeft: '20px' }}>
                        <Button className={classes.CloseButton}><CloseIcon/></Button>
                    </div>
                </div>
            </Toolbar>
        </AppBar>
    )
}

const ViewCorrespondencePage = () => {
    return (
        <div style = {{ paddingLeft: '80px', paddingTop: '80px' }}>
            <WindowHeader/>
        </div>
    );
}

export default ViewCorrespondencePage;
